<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Василиса Олеговна Медведева родится двадцать седьмого октября 2964. <br><p>Двадцать восьмого ноября 1980 устроится на работу в Фонд на должность механик-водителя. </p><p>	Окончательно уволится двадцать первого апреля 2332. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
